import React from "react";
import {useState} from "react";
import GetUserInput from "./GetUserInput";



function UserPage(){
    var County;
    var datetime;
    var temp;
    var humidity;
    var day_avg_prec_30;
    var day_avg_prec_60;
    var day_avg_prec_90;

    const [message, setMessage] = useState('');


    function handleSubmit(e){
        console.log("you click the button");
        console.log('county value is:', County);
        console.log('date value is:', datetime);
        console.log('temp value is:', temp);
        console.log('hum value is:', humidity);
    }


    const handleCountyChange = event => {
        setMessage(event.target.value);
            County = event.target.value
      };

    const handleDateChange = event => {
        setMessage(event.target.value);
            datetime = event.target.value
      };

    const handleTempChange = event => {
        setMessage(event.target.value);
            temp = event.target.value
      };

    const handleHumChange = event => {
        setMessage(event.target.value);
            humidity = event.target.value
      };

    const handle30Change = event => {
        setMessage(event.target.value);
            day_avg_prec_30 = event.target.value
        console.log('30 value is:', day_avg_prec_30);
      };

    const handle60Change = event => {
        setMessage(event.target.value);
            day_avg_prec_60 = event.target.value
        console.log('60 value is:', day_avg_prec_60);
      };
    const handle90Change = event => {
        setMessage(event.target.value);
            day_avg_prec_90 = event.target.value
        console.log('90 value is:', day_avg_prec_90);
      };


    return (
        <div>
            <h1>Hi this is a wildfire prediction</h1>

            <label>County: </label>
            <input 
                type="text" 
                id ="County" 
                name ="County" 
                onChange={handleCountyChange}
                value={message}
                placeholder="Enter County">
            </input>
            <br></br>

            <label>Date: </label>
            <input 
                type="date" 
                name="datetime"
                onChange={handleDateChange}
                value={message}
            ></input>
            <br></br>

            <label>Temp: </label>
            <input 
                type="float" 
                name="temp" 
                onChange={handleTempChange}
                value={message}
                placeholder="Enter Temp in Celius">
            </input>
            <br></br>

            <label>Hum: </label>
            <input 
                type="float" 
                name="Hum" 
                onChange={handleHumChange}
                value={message}
                placeholder="Enter Hum in %">
            </input>
            <br></br>

            <label>30-day avg prec: </label>
            <input 
                type="float" 
                name="30-day avg prec" 
                onChange={handle30Change}
                value={message}
                placeholder="Enter 30-day avg precipitation in inches">
            </input>
            <br></br>

            <label>60-day avg prec: </label>
            <input 
                type="float" 
                name="60-day avg prec" 
                onChange={handle60Change}
                value={message}
                placeholder="Enter 60-day avg precipitation in inches">
            </input>
            <br></br>

            <label>90-day avg prec: </label>
            <input 
                type="float" 
                name="90-day avg prec" 
                onChange={handle90Change}
                value={message}
                placeholder="Enter 90-day avg precipitation in inches">
            </input>
            <br></br>

            <button type="button" name= "submit" onClick={handleSubmit}>Sumbit</button>
        </div>
    );
}

export default UserPage;
